import { Tabs, Tab } from "@mui/material";
import HomeIcon from '@mui/icons-material/Home';


const Navbar = () => {
    return (
        <div>
            <Tabs>
                <Tab label={"Home"} icon={ <HomeIcon /> } sx={{ color: '#ffffff' }} />
            </Tabs>
        </div>
    )
}

export default Navbar;
